import React, { lazy, Suspense } from 'react';
import { Row, Col } from 'antd';
//import { GlobalLoading } from './../../components';
import { ToolPost, ListContent, ToolWeather } from './Components';
import './styles.css';

function Home(props) {
    return (
        <>
            <Row gutter={[34, 34]}>
                <Col lg={10} md={10}>
                    <ToolPost />
                </Col>
                <Col lg={12} md={12}>
                    <ToolWeather />
                </Col>
            </Row>
            <Row gutter={[34, 34]}>
                <Col>
                    <ListContent />
                </Col>
            </Row>
        </>
    );
}
export default Home;
